// src/components/Search.js
import React, { useState } from 'react';
import { ChevronDown } from 'lucide-react';

const Search = () => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [isSubmitted, setIsSubmitted] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    if (query.trim() === '') {
      setResults([]);
      return;
    }
    setResults([
      `Result for "${query}" 1`,
      `Result for "${query}" 2`,
      `Result for "${query}" 3`,
    ]);
    setIsSubmitted(true);
  };

  return (
      <div className="relative w-full max-w-xl mx-auto mt-0 h-auto overflow-y-auto">
      <div className="bg-gray-300/10 rounded-3xl shadow-lg relative w-full p-6 mt-0">
        <h1 className="text-3xl font-bold mb-4">Search Page</h1>
        <form onSubmit={handleSearch} className="flex flex-col space-y-4 mb-4">
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="Search..."
            className={`w-full bg-[rgba(108,108,108,0.3)] rounded-full p-2 pl-4 text-white ${
              !query ? 'border border-[rgb(255,255,255)] border-2px' : ''
            }`}
          />
          <button
            type="submit"
            className="self-start px-4 py-1 text-sm font-bold rounded-full bg-blue-800"
          >
            Search
          </button>
        </form>
        <div>
          {isSubmitted && results.length > 0 && (
            <ul className="list-disc pl-5">
              {results.map((result, index) => (
                <li key={index} className="mb-2 text-white">
                  {result}
                </li>
              ))}
            </ul>
          )}
          {isSubmitted && results.length === 0 && (
            <p className="text-red-500">No results found for "{query}".</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Search;
